
public class ArthEX {
	   
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		   int num1=20;
	       int num2=50;
	       System.out.println(num1+num2);
	       
	       
	       int num3=50;
	       int num4=60;
	       System.out.println(num1-num2);
	       
	       
	       int num5=20;
	       int num6=50;
	       System.out.println(num5*num6);
	       
	       
	       double num7=20;
	       double num8=50;
	       System.out.println(num7/num8);
	       
	       
	       
	       int num9=20;//50%20=10 it gives a reminder value
	       int num10=50;
	       System.out.println(num10%num9);
	       
	       
	       
	       int num11=num1+num2+num3+num4+num5+num6+(int)num7+(int)num8+num9+num10;
	       System.out.println(num11);
	       
	       double num12=num1-num2-num3-num4-num5-num6-(int)num7-(int)num8-num9-num10;
	       System.out.println(num12);
	       
	       int num13=num1*num2*num3*num4*num5*num6*(int)num7*(int)num8*num9*num10;
	       System.out.println(num13);
	      
	      
	       float num14=num1/num2/num3/num4/num5/num6/(int)num7/(int)num8/num9/num10;
	       System.out.println(num14);
	      
	       
        byte num=(byte)10000000;
        System.out.println(num);
	}

}
